import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first visible "Add to Cart" button using text
    await page.waitForSelector('button:has-text("Add to Cart")', { timeout: 5000 });

    // Rapidly add multiple products to the cart using different selectors
    // 1. First product: by nth "Add to Cart" button
    const addToCartButtons = await page.$$('button.add-to-cart');
    for (let i = 0; i < Math.min(3, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      // Wait for notification to appear and disappear (if any)
      await page.waitForTimeout(400);
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_some.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_some.png'));

    // 2. Add to cart from product detail modal (simulate stress: open, add, close, repeat)
    for (let i = 0; i < 2; i++) {
      // Click the first product card by its title text
      const productTitles = await page.$$('h3.product-title');
      if (productTitles.length > 0) {
        await productTitles[0].click();
        await page.waitForSelector('.modal[style*="display: block"]', { timeout: 5000 });
        // Wait for modal "Add to Cart" (large button)
        await page.waitForSelector('.modal .add-to-cart.large', { timeout: 5000 });
        await page.click('.modal .add-to-cart.large');
        // Wait for notification and close modal
        await page.waitForTimeout(400);
        // Try to close modal by clicking the close button (span.close)
        const closeBtn = await page.$('.modal .close');
        if (closeBtn) await closeBtn.click();
        await page.waitForTimeout(200);
      }
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_adds.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_adds.png'));

    // 3. Add to cart from list view (switch view, then add)
    // Switch to list view using the view toggle button (by title)
    await page.click('button.view-btn[title="List View"]');
    await page.waitForSelector('.products-list', { timeout: 5000 });
    // Add to cart from first product in list view
    const listAddBtns = await page.$$('.products-list .add-to-cart');
    if (listAddBtns.length > 0) {
      await listAddBtns[0].click();
      await page.waitForTimeout(400);
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_listview_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_listview_add.png'));

    // 4. Open cart and rapidly increment/decrement quantity
    // Click the cart icon by its class ('.cart'), then wait for modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Find all quantity "+" buttons and click each twice
    const plusBtns = await page.$$('#cartModal .quantity-btn:nth-of-type(3)');
    for (const btn of plusBtns) {
      await btn.click();
      await page.waitForTimeout(200);
      await btn.click();
      await page.waitForTimeout(200);
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_increment.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_cart_increment.png'));

    // Rapidly remove items from cart (click all "Remove" buttons)
    const removeBtns = await page.$$('#cartModal .remove-item');
    for (const btn of removeBtns) {
      await btn.click();
      await page.waitForTimeout(200);
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_cart_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_cart_removed.png'));

    // Extract cart count from the cart counter (should be 0 or low)
    let cartCount = null;
    try {
      await page.waitForSelector('#cartCount', { timeout: 2000 });
      cartCount = await page.$eval('#cartCount', el => el.textContent.trim());
    } catch (e) {
      cartCount = 'not found';
    }

    // Close cart modal if open
    const closeCartBtn = await page.$('#cartModal .close');
    if (closeCartBtn) await closeCartBtn.click();

    return {
      success: true,
      action: "Performed rapid cart manipulation: added via grid, modal, list view, incremented quantities, and removed all items.",
      extractedData: {
        finalCartCount: cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
